import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  return (
    <div class="relative min-h-screen  grid bg-black text-center text-white p-4 font-b text-2xl font-bold">
      <h1 class="text-white p-4 font-b text-center text-5xl font-bold">CREER UN COMTE</h1>
      <form className="flex flex-col sm:flex-row items-center md:items-start sm:justify-center md:justify-start flex-auto min-w-0">
      <label class="pr-95">
      Email <br />
      <input class="pt-15 focus:outline-none w-3/5 bg-transparent rounded-full border border-2 border-cyan-300 text-ms" type="text" name="name" /><br />
      </label>
      <label className="pt-15">
      mot de passe <br />
      <input class="focus:outline-none w-3/5 bg-transparent rounded-full border border-2 border-cyan-300 text-ms" type="password" /><br />
      </label>
      <input type="submit" value="Submit" />
      </form>        
    </div>
  );
}

export default App;
